import React from "react";
import profilePhoto from "../assets/profile.png";

const About = () => {
  return (
    <section id="about">
      <h2>Tentang Saya</h2>
      <img
        src={profilePhoto}
        alt="Foto Profil"
        style={{ width: "150px", height: "220px", borderRadius: "5%", marginBottom: "20px" }}
      />
      <p>
        Saya seorang Software Engineer dengan pengalaman di pengembangan web dan mobile.
        Saya memiliki pengalaman dalam pengembangan web menggunakan <strong>Node.js</strong> dan mobile menggunakan <strong>Flutter</strong>.
      </p>
    </section>
  );
};

export default About;
